import './App.css';
import Background from "./Background";
import Dhikr from "./Dhikr";
import Search from "./Search";
import Shortcuts from "./Shortcuts";



function App() {
  return (

<div className= "mid-search">
<Dhikr/>
<Search/>
<Shortcuts/>
<Background/>
</div>
  );
}


export default App;
